(33, 6, 'Olympian Network', 'olympian-network', '', NULL, '', 'https://discord.gg/PTKFBuF', 'You join one of four kingdoms. Once you start you must work with your kingdom to upgrade your town hall, query, farm, and dungeon to gain resources. Also your blacksmith, armor smith, and tool smith to gain an edge in battle. Fight other kingdoms over shrines and mount Olympus itself to gain buffs for your kingdom. Take down bosses and the fight in the labyrinth before your enemies can take can. And the best part participate in weekend raids where your kingdom can vote on a other kingdom to raid. All complete with a point system for grinding and raiding to award a winning kingdom each season and custom items and mobs.(This is are first game we may have more in the future)', '', 0, 0, 1, 6, '1.12.2', 'Hardcore,Roleplay,Survival', 'us', '100', , 32056, NULL, 0, NULL, '', '', 8192, '', '2019-09-01 14:59');
